var mongoose = require("mongoose");
var userSchema = joi.object({
  name: joi.string(),
  email: joi.string().email({
    minDomainSegments: 2,
    tlds: {
      allow: ["com", "net"]
    }
  }).required().trim().lowercase(),
  password: joi.string().pattern(new RegExp("^[a-zA-Z0-9]{3,30}$")).required().trim(),
