});
var User = mongoose.model("users", {
  email: {
    type: String,
    required: true,
    unique: true
  },
  password: {
    type: String,
    required: true
  },
  confirmPassword: {
    type: String
  },
  verified: {
    type: Boolean,
    "default": false
  },
  otp: {
    type: Number
  }
});
module.exports = {
  userSchema: userSchema,
  User: User
};
